import mongoose from "mongoose";
import Course from "./UserModels/user.schema";
import User from "./UserModels/user.schema";
const handleCreateCourseService = async (body) => {
  const response = {
    statusCode: 201,
    message: "Created success!",
    data: {},
  };
  const res = new Course({
    _id: mongoose.Types.ObjectId(),
    title: body.title,
    description: body.description,
  });
  const newCourse = await Course.create(res);
  response.statusCode = 201;
  response.data = newCourse;
  response.message = "success";

  return response;
};
const handleGetCourseService = async () => {
  const response = {
    statusCode: 200,
    message: "Get all category success!",
    data: {},
  };
  try {
    const features = await Course.find();
    response.data = features;
  } catch (err) {
    response.statusCode = 500;
    response.message = err.message;
  }
  return response;
};
const handleGetSingleCourseService = async (body) => {
  const response = {
    statusCode: 200,
    message: "Get all category success!",
    data: {},
  };
  try {
    const course = await Course.findById(body.id);
    response.data = course;
  } catch (err) {
    response.statusCode = 500;
    response.message = err.message;
  }
  return response;
};
const handleUpdateCourseService = async (body) => {
  const response = {
    statusCode: 201,
    message: "update all category success!",
    data: {},
  };
  try {
    const course = await Course.findOneAndUpdate(
      { _id: body.id },
      { $set: body }
    ).exec();
    response.data = course;
  } catch (err) {
    response.statusCode = 500;
    response.message = err.message;
  }
  return response;
};

const handleCreateNewUserService = async (body) => {
  const res = {
    statusCode: 201,
    message: "create new user success",
    data: {},
  };
  try {
    const user = await new User({
      _id: mongoose.Types.ObjectId(),
      name: body.name,
      age: body.age,
      clazz: body.clazz,
      role: body.role,
      dob: body.dob,
    });
    const newUser = await User.create(user);
    res.data = newUser;
  } catch (error) {
    res.statusCode = 500;
    res.message = "create new user error";
  }
  return res;
};

const handleGetSingleUserService = async (query) => {
  const res = {
    statusCode: 200,
    message: "get user success",
    data: {},
  };
  try {
    const user = await User.findById(query.id).populate({path: 'clazz', select: 'name isDeleted'})
    res.data = user;
  } catch (error) {
    res.statusCode = 500;
    res.message = "get user error";
  }
  return res;
};
module.exports = {
  handleCreateCourseService,
  handleGetCourseService,
  handleGetSingleCourseService,
  handleUpdateCourseService,
  handleCreateNewUserService,
  handleGetSingleUserService,
};

