mongoose.Promise = global.Promise;

const CLAZZ_MODEL = "clazzes"

const classSchema = new mongoose.Schema({
  _id: mongoose.Schema.Types.ObjectId,
  name: {
    type: String,
    required: true,
  },
  isDeleted: {
    type: Boolean,
    required: true,
    default: false,
  },
},{timestamps: true , collection: CLAZZ_MODEL});

export default mongoose.model("clazz", classSchema);

